public class Solution {
    public long ContinuousSubarrays(int[] nums) {
        long count = 0;
        int left = 0;
        for (int right = 0; right < nums.Length; ++right) {
            for (int i = left; i <= right; ++i) {
                if (Math.Abs(nums[i] - nums[right]) > 2) {
                    left = i + 1;
                }
            }
            count += right - left + 1;
        }
        return count;
    }
}
